import React from "react";
import HighlightOffIcon from '@material-ui/icons/HighlightOff';

let ToDoList1 = (props) => {
    return <span className = "delete"><HighlightOffIcon className = "addBtn"/><li>{props.text}</li></span>
}

export default ToDoList1;
